from app.process.base64conversion import *
from os.path import join, dirname, realpath, isdir, split

base_path = split(dirname(realpath(__file__)))
TEST_FOLDER = join(base_path[0], 'test', 'test_base64_support')
TEST_IMAGE_FILE = 'dress0.png'
TEST_IMAGE_PATH = join(TEST_FOLDER, TEST_IMAGE_FILE)
TEST_b64_String = """"""


def test_to_base64():
    # def to_base64(img):
    b64 = to_base64(TEST_IMAGE_PATH)
    assert b64 == TEST_b64_String


def test_from_base64():
    # def from_base64(b64_string):
    img = from_base64(TEST_b64_String)
    assert img.shape == (320, 320, 3)
    assert img[0][0][0] == 155
    assert img[0][0][1] == 179
    assert img[0][0][2] == 196


def test_get_html():
    testString = "TEST"
    assert get_html(testString) == "data:image/png;base64,TEST"
